import React, { useEffect, useState } from "react";
import axios from "axios";

export default function Ambulance() {
    const [ambulance, setAmbulances] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8080/ambulance/all")
            .then(response => setAmbulances(response.data))
            .catch(error => console.error("Error fetching users:", error));
    }, []);

    const addsetAmbulances = async (newsetAmbulances) => {
        try {
            const response = await axios.post("http://localhost:8080/ambulance/add", newsetAmbulances);
            console.log("setAmbulances added:", response.data);
            setAmbulances([...ambulance, response.data]);
        } catch (error) {
            console.error("Error adding user:", error);
        }
    };

    return (

          <div>
            <h2>Ambulances List</h2>
            <ul>
                {ambulance.map(user => (
                    <li key={user.ambulance_num_plate}>
                        {user.driver_contact} ({user.oxygen_status})
                    </li>
                ))}
            </ul>
            </div>
    );
}
